  selector: "app-movie",
  templateUrl: "./movie.component.html",
  styleUrls: ["./movie.component.scss"],
})
export class MovieComponent {
  type = "";
  id = "";

  constructor(private route: ActivatedRoute) {}
}
<app-header></app-header>
<div class="movie-container">
  <div class="top">
    <div class="left">
      <div class="name"></div>
